	var layers = [];

	var nodes = [];
	for( var i = 0 ; i <= config.inputs ; i++ ) {
		nodes.push( -1 );
	}
	layers.push( { nodes : nodes } );

	layers.push( { connections : createRandomConnections( config.hiddenNodesPerLayer , config.inputs + 1 ) } );

